// Contact.jsx
export function Contact() {
  return (
    <section className="p-8 bg-indigo-50 text-center" data-aos="fade-up">
      <h2 className="text-4xl font-bold mb-4 border-b-4 inline-block border-indigo-500">Contact</h2>
      <p className="text-lg">Email: <a href="mailto:laeebajaved@gmail.com" className="underline">laeebajaved@gmail.com</a></p>
      <p className="text-lg">Phone: +91 9068138222</p>
    </section>
  );
}
